import React from 'react';
import UHeader from './UHeader';
import Footer from './Footer';

import {Link} from 'react-router-dom';
import Nav from 'react-bootstrap/Nav';
import UButton from './utilities/UButton';

export default () => {
    const selections = [
        <Nav.Link key={'1'} as={Link} to={'/'}>
            <UButton variant={'secondary-outline'}>Home</UButton>
        </Nav.Link>,
        <Nav.Link key={'2'} as={Link} to={'/create_account'}>
            <UButton variant={'secondary-outline'}>Sign Up</UButton>
        </Nav.Link>,
    ];

    return (
        <div style={{backgroundColor: '#f8f9fa'}}>
            <UHeader selections={selections} />
            {/* Content is dynamically added based on the url */}
            <Footer />
        </div>
    );
};
